import React, { Component } from 'react';

import styles from './Info.module.scss';

export default class Info extends Component {
    constructor(props){
        super(props);
    }


    render() {

        return (
            <div className={styles.block}>
                <h1>Info</h1>
            </div>
        );
    }
}
